import React from 'react';

import Color from 'color-thief-react';


const Header = (props) => {
    return (
        <div className="header">
            <p className="header__title"><b>{props.title}</b></p>
            <p className="header__subtitle">{props.subtitle}</p>

            <Color src={"https://avatars2.githubusercontent.com/u/17098793?s=400&u=fff14416a083b2c3524ce472f0b77cad2e1fd369&v=4"}>
                {({ data, loading, error }) => (
                    <div style={{ color: data }}>
                        Text with the predominant color
                    </div>
                )}
            </Color>


        </div>
    );
}

export default Header;
